import './comp.css';

function Comp18() {
    let arr2 = [
        <li>1</li>,
        <li>2</li>,
        <li>3</li>,
    ];

    let arr3 = arr2.map(function (item, index) {
        return <span key={index}>key - {index}, item - {item}; </span>
    })

    return (
        <div className="comp comp18">
            <h3><span>18</span>render elems from array</h3>
            <div>
                <ul>
                    {arr3}
                </ul>
            </div>
        </div>
    )
}

export default Comp18;
